export default function Login({ setUser }) {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-orange-500 to-red-500">
      <div className="bg-white p-8 rounded-xl shadow w-80 text-center">
        <h2 className="font-bold text-xl mb-4">FoodDash Login</h2>
        <button className="btn" onClick={() => setUser("nick")}>Admin</button>
        <button className="btn" onClick={() => setUser("marvel")}>Manager</button>
        <button className="btn" onClick={() => setUser("thanos")}>Member</button>
      </div>
    </div>
  );
}
